Here is a sample Spark job to calculate the hit rate for onsite attributed data:

```java
import org.apache.spark.api.java.JavaRDD;
import org.apache.spark.api.java.JavaSparkContext;
import org.apache.spark.api.java.function.Function;
import org.apache.spark.api.java.function.PairFunction;
import org.apache.spark.broadcast.Broadcast;
import scala.Tuple2;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

public class HitRateCalculator {

    public static void main(String[] args) {
        JavaSparkContext sc = new JavaSparkContext("local[*]", "HitRateCalculator");

        // Load onsite attributed data
        JavaRDD<String> onsiteData = sc.textFile("onsite_data.txt");

        // Load top frequent queries
        JavaRDD<String> topQueries = sc.textFile("top_queries.txt");

        // Broadcast top queries to all nodes
        final Broadcast<List<String>> broadcastTopQueries = sc.broadcast(topQueries.collect());

        // Extract query and timestamp from onsite data
        JavaRDD<Tuple2<String, Long>> onsiteQueries = onsiteData.map(new Function<String, Tuple2<String, Long>>() {
            @Override
            public Tuple2<String, Long> call(String line) throws Exception {
                String[] parts = line.split(",");
                return new Tuple2<>(parts[0], Long.parseLong(parts[1]));
            }
        });

        // Filter onsite queries that are in top queries
        JavaRDD<Tuple2<String, Long>> filteredQueries = onsiteQueries.filter(new Function<Tuple2<String, Long>, Boolean>() {
            @Override
            public Boolean call(Tuple2<String, Long> tuple) throws Exception {
                return broadcastTopQueries.value().contains(tuple._1);
            }
        });

        // Calculate cache hits and misses
        Map<String, Long> cache = new HashMap<>();
        List<Tuple2<String, Long>> cacheHits = new ArrayList<>();
        List<Tuple2<String, Long>> cacheMisses = new ArrayList<>();

        for (Tuple2<String, Long> query : filteredQueries.collect()) {
            if (cache.containsKey(query._1)) {
                long lastAccess = cache.get(query._1);
                if (query._2 - lastAccess <= 12 * 60 * 60 * 1000) { // 12 hours in milliseconds
                    cacheHits.add(query);
                } else {
                    cacheMisses.add(query);
                }
            } else {
                cacheMisses.add(query);
            }
            cache.put(query._1, query._2);
        }

        // Calculate hit rate
        double hitRate = (double) cacheHits.size() / (cacheHits.size() + cacheMisses.size());

        System.out.println("Hit rate: " + hitRate);
    }
}
```

This job loads the onsite attributed data and top frequent queries, extracts the query and timestamp from the onsite data, filters the queries that are in the top queries, and calculates the cache hits and misses. It then calculates the hit rate as the number of cache hits divided by the total number of queries.

