```javascript
import React from 'react';
import { useMutation } from '@apollo/client';
import { ADD_DATA } from './mutations';

function MyForm() {
  const [addData, { data, loading, error }] = useMutation(ADD_DATA);

  const onSubmit = async (event) => {
    event.preventDefault();

    const formData = new FormData(event.target);
    const variables = Object.fromEntries(formData);

    try {
      const response = await addData({ variables });
      console.log('Data added:', response.data);
    } catch (error) {
      console.error('Error adding data:', error);
    }
  };

  return (
    <form onSubmit={onSubmit}>
      {/* form fields go here */}
      <button type="submit">Submit</button>
    </form>
  );
}

export default MyForm;
```
In this example, we're using the `useMutation` hook from Apollo Client to execute a GraphQL mutation. The `ADD_DATA` mutation is imported from a separate file, which should look something like this:
