  mutation AddData($input: DataInput!) {
    addData(input: $input) {
      id
      field1
      field2
      # etc.
    }
  }
`;
```
The `onSubmit` function is called when the form is submitted. It prevents the default form submission behavior, extracts the form data into an object, and then calls the `addData` function with the form data as variables. If the mutation is successful, the response data is logged to the console. If there's an error, it's caught and logged to the console as well.

